import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
  Container,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  TextField,
  Box,
  Typography,
  CircularProgress,
  TablePagination,
  TableSortLabel,
  Grid,
  InputAdornment,
} from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';

function App() {
  const [pairs, setPairs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [page, setPage] = useState(0);
  const [rowsPerPage, setRowsPerPage] = useState(10);
  const [orderBy, setOrderBy] = useState('pairName');
  const [order, setOrder] = useState('asc');
  const [filters, setFilters] = useState({
    search: '',
    minVolume: '',
    minApr: '',
  });

  useEffect(() => {
    const fetchPairs = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/pairs');
        setPairs(response.data.data);
        setLoading(false);
      } catch (err) {
        setError('Error fetching pairs data');
        setLoading(false);
      }
    };

    fetchPairs();
  }, []);

  const handleSort = (property) => {
    const isAsc = orderBy === property && order === 'asc';
    setOrder(isAsc ? 'desc' : 'asc');
    setOrderBy(property);
  };

  const handleFilterChange = (field) => (event) => {
    setFilters(prev => ({
      ...prev,
      [field]: event.target.value
    }));
    setPage(0);
  };

  const filteredPairs = pairs.filter(pair => {
    const matchesSearch = pair.pairName.toLowerCase().includes(filters.search.toLowerCase());
    const matchesVolume = !filters.minVolume || pair.volume24h >= Number(filters.minVolume);
    const matchesApr = !filters.minApr || pair.apr >= Number(filters.minApr);
    return matchesSearch && matchesVolume && matchesApr;
  });

  const sortedPairs = filteredPairs.sort((a, b) => {
    if (order === 'asc') {
      return a[orderBy] > b[orderBy] ? 1 : -1;
    } else {
      return b[orderBy] > a[orderBy] ? 1 : -1;
    }
  });

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(parseInt(event.target.value, 10));
    setPage(0);
  };

  const columns = [
    { id: 'pairName', label: 'Pair Name', numeric: false },
    { id: 'price', label: 'Price', numeric: true },
    { id: 'volume24h', label: '24h Volume', numeric: true },
    { id: 'fees24h', label: '24h Fees', numeric: true },
    { id: 'apr', label: 'APR (%)', numeric: true },
    { id: 'apy', label: 'APY (%)', numeric: true },
    { id: 'reserveX', label: 'Reserve X', numeric: true },
    { id: 'reserveY', label: 'Reserve Y', numeric: true },
  ];

  if (loading) {
    return (
      <Container sx={{ display: 'flex', justifyContent: 'center', mt: 4 }}>
        <CircularProgress />
      </Container>
    );
  }

  if (error) {
    return (
      <Container>
        <Typography color="error" sx={{ mt: 4 }}>{error}</Typography>
      </Container>
    );
  }

  return (
    <Container maxWidth="xl" sx={{ mt: 4 }}>
      <Typography variant="h4" gutterBottom>
        Meteora Trading Pairs
      </Typography>

      <Grid container spacing={2} sx={{ mb: 3 }}>
        <Grid item xs={12} md={4}>
          <TextField
            fullWidth
            label="Search Pairs"
            variant="outlined"
            value={filters.search}
            onChange={handleFilterChange('search')}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <SearchIcon />
                </InputAdornment>
              ),
            }}
          />
        </Grid>
        <Grid item xs={12} md={4}>
          <TextField
            fullWidth
            label="Min 24h Volume"
            variant="outlined"
            type="number"
            value={filters.minVolume}
            onChange={handleFilterChange('minVolume')}
          />
        </Grid>
        <Grid item xs={12} md={4}>
          <TextField
            fullWidth
            label="Min APR %"
            variant="outlined"
            type="number"
            value={filters.minApr}
            onChange={handleFilterChange('minApr')}
          />
        </Grid>
      </Grid>

      <TableContainer component={Paper}>
        <Table sx={{ minWidth: 650 }} aria-label="pairs table">
          <TableHead>
            <TableRow>
              {columns.map((column) => (
                <TableCell
                  key={column.id}
                  align={column.numeric ? 'right' : 'left'}
                  sortDirection={orderBy === column.id ? order : false}
                >
                  <TableSortLabel
                    active={orderBy === column.id}
                    direction={orderBy === column.id ? order : 'asc'}
                    onClick={() => handleSort(column.id)}
                  >
                    {column.label}
                  </TableSortLabel>
                </TableCell>
              ))}
            </TableRow>
          </TableHead>
          <TableBody>
            {sortedPairs
              .slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
              .map((pair, index) => (
                <TableRow
                  key={index}
                  sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                >
                  <TableCell>{pair.pairName}</TableCell>
                  <TableCell align="right">
                    ${Number(pair.price).toLocaleString(undefined, { minimumFractionDigits: 6 })}
                  </TableCell>
                  <TableCell align="right">
                    ${Number(pair.volume24h).toLocaleString()}
                  </TableCell>
                  <TableCell align="right">
                    ${Number(pair.fees24h).toLocaleString()}
                  </TableCell>
                  <TableCell align="right">
                    {Number(pair.apr).toLocaleString()}%
                  </TableCell>
                  <TableCell align="right">
                    {Number(pair.apy).toLocaleString()}%
                  </TableCell>
                  <TableCell align="right">
                    {Number(pair.reserveX).toLocaleString()}
                  </TableCell>
                  <TableCell align="right">
                    {Number(pair.reserveY).toLocaleString()}
                  </TableCell>
                </TableRow>
            ))}
          </TableBody>
        </Table>
        <TablePagination
          rowsPerPageOptions={[10, 25, 50, 100]}
          component="div"
          count={sortedPairs.length}
          rowsPerPage={rowsPerPage}
          page={page}
          onPageChange={handleChangePage}
          onRowsPerPageChange={handleChangeRowsPerPage}
        />
      </TableContainer>
    </Container>
  );
}

export default App;
